import LogoOrgano from "../LogoOrgano"
import "./Rodape.css"

const Rodape = ()=>{
    return(
        <footer className="rodape">
            <div className="redesSociais">
                <LogoOrgano/>
            </div>
            <h3>Desenvolvido por Luiz Marangoni</h3>
        </footer>
    )
}

export default Rodape
